        },
        createdAt: 1554757200000,
        status: 'pending'
      },
      {
        id: uuid(),
        ref: 'CDD1045',
        amount: 32.54,
        customer: {
          name: 'Clarke Gillebert'
        },
        createdAt: 1554670800000,
        status: 'delivered'
      },
      {
        id: uuid(),
        ref: 'CDD1044',
        amount: 16.76,
        customer: {
          name: 'Adam Denisov'
        },
        createdAt: 1554670800000,
        status: 'delivered'
      }
    ];

  return (
    <Card >
       <CardHeader title="Jackpot Log" />
       <Divider />
       <PerfectScrollbar>
         <Box sx={{ minWidth: 800 }}>
           <Table>
             <TableHead>
               <TableRow>
                 <TableCell>
                 Transaction History
                 </TableCell>
                 <TableCell>
                   Customer
                 </TableCell>
                 <TableCell sortDirection="desc">
                   <Tooltip
                      enterDelay={300}
                      title="Sort"
                    >
                      <TableSortLabel
                        active
                        direction="desc"
                      >
                        Date
                      </TableSortLabel>
                    </Tooltip>
                  </TableCell>
                  <TableCell>
                    Status
                  </TableCell>
                  <TableCell>
                    Status
                  </TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {transactions.map((transaction) => (
                  <TableRow
                    hover
                    key={transaction._id}
                  >
                    <TableCell>
                      {transaction._id}
                    </TableCell>
                    <TableCell>
                      {transaction.name}
                    </TableCell>
                    <TableCell>
                      {moment(transaction.date).format('DD/MM/YYYY')}
                    </TableCell>
                    <TableCell>
                      <Chip
                        color="primary"
                        label={transaction.sign}
                        size="small"
                      />
                    </TableCell>
                    <TableCell>
                      {transaction.totalIGC}
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Box>
        </PerfectScrollbar>
        <Box
          sx={{
            display: 'flex',
            justifyContent: 'flex-end',
            p: 2
          }}
        >
          <Button
            color="primary"
            endIcon={<ArrowRightIcon />}
            size="small"
            variant="text"
          >
            View all
          </Button>
        </Box>
      </Card>
  )
}

export default TransactionHistory

